import {Routes, Route, useNavigate} from 'react-router-dom';

const Navigate = () => {
    const nav = useNavigate();

    const navToSignUp = () => {
        console.log("Navigating to Sign Up")
        nav('/Register')
    }

    const navToLogin = () => {
        nav('/Login')
    }
}

export default Navigate;
